import React from 'react';

function ProfileHeader(props) {
  const { profile } = props;
  console.log(props);
  return (
    <div>
      {profile.map(data => (
          <h1>{data.name}</h1>
      ))}
    </div>
  );
}

export default ProfileHeader;
